(14, 31, 'Home', '<span style="color: rgb(111, 111, 111); font-family: ''Century Gothic''; font-size: 15px; line-height: 27px;">orn in 1992, MGH commenced its journey by representing Gillette in Bangladesh as a Distributor. Over the past 23 years, MGH has made core investments into Pharma and FMCG Contract Logistics, Supply Chain Solutions, Ocean Carriers, and Airlines GSA representations, IT Solutions, Inland Container Terminal Management, Food &amp; Beverage Retail, FM Radio, Cable Television Network, Tea &amp; Rubber Plantation, Commercial, &amp; Retail Banking, Computer Reservation System (CRS) Distribution, Internet Booking Engine, and Inventory of Premium Land Bank respectively.</span><br style="color: rgb(111, 111, 111); font-family: ''Century Gothic''; font-size: 15px; line-height: 27px;"><br style="color: rgb(111, 111, 111); font-family: ''Century Gothic''; font-size: 15px; line-height: 27px;"><span style="color: rgb(111, 111, 111); font-family: ''Century Gothic''; font-size: 15px; line-height: 27px;">Born in Bangladesh, now Head Quartered out of Singapore, MGH owned operations span all across Hong Kong, India, Pakistan, Sri Lanka, Nepal, Myanmar, Thailand, Vietnam, Cambodia, Mauritius, Qatar, Egypt, the United Arab Emirates, Kazakhstan and Nigeria.</span><br style="color: rgb(111, 111, 111); font-family: ''Century Gothic''; font-size: 15px; line-height: 27px;"><br style="color: rgb(111, 111, 111); font-family: ''Century Gothic''; font-size: 15px; line-height: 27px;"><span style="color: rgb(111, 111, 111); font-family: ''Century Gothic''; font-size: 15px; line-height: 27px;">With over 900 talented associates in majority recruited straight from various campuses of the world transformed into effective thinkers, innovators, team players, leaders forming the driving force, and growth-engine of the group.</span>', NULL, NULL, 31, NULL),
